import React, { useEffect, useState } from 'react';

const TableData = () => {
    const [show,setShow]= useState(false);
    const [users, setUsers] = useState([]);
    setShow(!show)
    useEffect(() => {
        fetch('/users')
            .then(res => res.json())
            .then(data => setUsers(data))
    }, []);

    return (
        <div>
            <h1 className="text-4xl text-center my-10">
                Dynamic Data in Table
            </h1>

            <div>
                <div className="overflow-x-auto">
                    <table className="table w-full">
                        <thead>
                            <tr>
                                <th>ID</th>
                                <th>Name</th>
                               
                            </tr>
                        </thead>
                        <tbody>





                        {show &&<div className="d-flex flex-row align-items-center mb-4">
                          <i className="fas fa-key fa-lg me-3 fa-fw"></i>
                          <div className="form-outline flex-fill mb-0">
                            <input  name="AdminEmail" type="email" id="form3Example4cd" className="form-control" />
                            <label className="form-label" for="form3Example4cd">Admin Email if you are not a admin</label>
                          </div>
                        </div>}     

      {/* <div>

      { 
      show && Object.keys(users.object).map((key, i) => (
          <p key={i}>
            <span>Key Name: {key}</span>
            <span>Value: {users.object[key]}</span>
          </p>
        ))
      }
    </div> */}
                
                       
                        
                            {
                                users.map((user) =>
                                    <tr>
                                        
                                        <th>{user.id}</th>
                                        <td>{user.name}</td>
                                       
                                    </tr>
                                )
                            }

                        </tbody>
                    </table>
                </div>
            </div>

        </div>
    );
};

export default TableData;
